import './Title.css';

// Title view
export default function REturnTitle() {
 return (
  <div className='wrp-title-bank'>
   <h1>Get a bank account that can do more</h1>
   <p>
    Lors de la comparaison des types de paramètres de fonction,
    l'affectation réussit si le paramètre source peut être affecté
    au paramètre cible, ou vice versa. Cela n'est pas sain car un appelant
    pourrait finir par se voir attribuer une fonction qui prend un
    type plus spécialisé,
   </p>
  </div>
 );
};
